import React from 'react';

function Card(){
	return (
		<div className='bg-light-blue dib br3 pa3 ma2 grow'>
			<div>
				<h1 className="tc">Pokemon List </h1>
			</div>
			<img alt="" src="https://cdn.bulbagarden.net/upload/2/21/001Bulbasaur.png"/>
			<div>
				<h2>Bulbasaur</h2>
			</div>
		</div>
	);
}

export default Card;
